public final boolean incrementToken() throws IOException {
  // lazy init the iterator
  if (it == null) {
    it = cachedStates.iterator();
  }

  if (!it.hasNext()) {
    return false;
  }

  AttributeSource.State state = (State) it.next();
  restoreState(state);
  return true;
}

